import React from 'react'
import './mymap.css'

const MyMap = () => {


    return (
        <div>


            <iframe className='myMap' src={`https://www.openstreetmap.org/export/embed.html?bbox=21.636199951171875%2C57.41833643643223%2C23.168792724609375%2C57.837441387883096&amp;marker=57.62849340768344%2C22.402496337890625`}>
            </iframe>


        </div >
    )
}

export default MyMap
